import * as React from 'react';
import './style.css'
import {Routes, Route, Link} from 'react-router-dom'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faMeteor, faMoneyBill, faMoneyBill1Wave, faPlaneDeparture, faRocket, faShuttleSpace, faSpaceShuttle, faStairs, faStarAndCrescent, faStarHalf, faStarHalfStroke } from '@fortawesome/free-solid-svg-icons';


export interface IHeaderProps {
}

export default class Header extends React.Component<IHeaderProps> {
  public render() {
    return (
      <div>
        <header>
          <div className='navBar'>
            <span className="material-symbols-outlined">home</span>
            <Link className='link' to='/'><div className='navItem'> Home<i/></div></Link>
            <Link className='link' to='/users'><div className='navItem'> Users<i/></div></Link>
            <Link className='link' to='/'><div className='navItem'> About<i/></div></Link>
            <Link className='link' to='/'><div className='navItem'> Services<i/></div></Link>
            <Link className='link' to='/'><div className='navItem'> Contact<i/></div></Link>
          </div>
        </header>
      </div>
    );
  }
}
